import * as React from 'react';
import { View, Text } from 'react-native';


export default function Chat() {
  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
    <Text>Chat</Text>
    <Text>alignConte</Text>

  </View>
  );
}
